import React from 'react';
import './App.css';
import logo from './logo.png'

function App () {
  return (
    <div className="{ 'sticky shadow-2': isSticky }" x-init="window.addEventListener('scroll', () => { isSticky = window.scrollY > 0 })"  x-data="{ isOpen: false,  isSticky: false, showSearch: false, searchModalOpen: false }">
      <nav className="flex lg:hidden mx-auto max-w-7xl px-10 items-center bg-white rounded-md py-2 justify-between " aria-label="Global">
      <div className="flex lg:flex-1">
            <a href="/" className="-m-1.5 p-1.5">
                <span className="sr-only">Your Company</span>
                <img src={logo} className="h-16 w-auto" alt="logo" />
            </a>
        </div>
      </nav>
    </div>


  );
}

export default App;
